import React from 'react';
import ProjectImages from '.components/styles/projectImages';

function Portfolio() {
  return (
    <section id="portfolio">
      <h2>Portfolio</h2>
      <div class="portfolio-items">
        <div class="portfolio-item">
          <img src="app1-thumbnail.jpg" alt="App 1" />
          <div class="portfolio-item-details">
            <h3>App 1 Title</h3>
            <p>Description of App 1</p>
            <div class="portfolio-links">
              <a href="https://app1-url.com">Demo</a>
              <a href="https://github.com/yourusername/app1">GitHub</a>
            </div>
          </div>
        </div>
      </div>
    </section>
    
  )}; 

export default Portfolio;
